export const Diffusion = () => {


    return (

<div className="video-container">

    <video id="v1" width="750" height="500" controls autoPlay={true} loop={true} >
      <source src={myVideo} type="video/mp4" />
    </video>

    <div id="v2" width="750" height="500" controls autoPlay={true} loop={true} >
      <video src= {require('./vdieos/DXM_SOLDES_INT.mp4')} type="video/mp4" />
    </div>

</div>

    )

}

export default Diffusion
